    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - col2 NOT IN ( - - 77 * + col0 * - col0, + col0, + + col1 );
  - name: tab1

outputs:
  - name: q4837.out
    data: |
      51	14	96
      85	5	59
      91	47	68
